-- Dumping structure for procedure meituan.get_shop_detail
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `get_shop_detail`(IN id varchar(32))
BEGIN

SELECT *  FROM meishi_shop_table AS shop  WHERE shop.ID = id;

SELECT 
    tag.name, tag.img
FROM
    meishi_shop_tag_table AS shop_tag
        LEFT JOIN
    meishi_tag_table AS tag ON shop_tag.tagID = tag.ID
WHERE
    shop_tag.shopID = id;
    

SELECT 
    *
FROM
    meishi_group_table
WHERE
    shopID = id;
    

SELECT 
    *
FROM
    meishi_voucher_table
WHERE
    shopID = id;
    

SELECT 
    *
FROM
    meishi_recommand_table
WHERE
    shopID = id;
    
SELECT 
    *, comment.ID AS ID
FROM
    meishi_comment_table AS comment
        LEFT JOIN
    user_table AS user ON comment.userID = user.ID;
    
END//
DELIMITER ;

