-- Dumping structure for procedure meituan.key_word
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `key_word`(IN kw varchar(32), IN size int)
BEGIN
declare sum int;
declare s_param varchar(34);
declare s_param2 varchar(36);

set s_param =concat(kw,"%");
set s_param2 = concat(',',kw,"%");
SELECT 
    COUNT(*)
INTO sum FROM
    catalog_item_table
WHERE
    title LIKE s_param
        OR title_pinyin LIKE s_param
        OR title_pinyin LIKE s_param2;
if sum >= size then
select title from catalog_item_table where title like s_param or title_pinyin like s_param or title_pinyin like s_param2 limit size;
else
select title from catalog_item_table where title like s_param or title_pinyin like s_param or title_pinyin like s_param2
UNION
select title from sub_catalog_table where title like s_param
limit size;
end if;

END//
DELIMITER ;

